import { Ollama } from "ollama";
// require('dotenv').config()

import { config } from "dotenv";
config();

const ollama = new Ollama({
  host: "https://ollama.com",
  headers: {
    Authorization: `Bearer ${String(process.env.OLLAMA_API_KEY)}`,
  },
});

console.log(process.env.OLLAMA_API_KEY);

const messages = [
  {
    role: "system",
    content:
      'You are an expert OCR and receipt parsing assistant. Extract structured data from the provided receipt image and return **valid JSON** matching the schema:\n\n```json\n{\n  "merchant": "string",\n  "date": "YYYY-MM-DD",\n  "currency": "INR|USD|...",\n  "items": [\n    {\n      "name": "string",\n      "qty": 1,\n      "price": 12.34,\n      "category": "food|drinks|utilities|transport|entertainment|other"\n    }\n  ],\n  "subtotal": 0,\n  "tax": 0,\n  "total": 0\n}\n```\n\nGuidelines:\n\n1. Read the receipt carefully. Capture merchant name, normalized ISO date, ISO currency code, subtotal, tax, and total.\n2. List each line item with quantity (defaults to `1` if unspecified) and unit price. Use decimal numbers, not strings.\n3. Categorize each item using:\n   - `food` — groceries, meals, snacks\n   - `drinks` — beverages, bars, cafes\n   - `utilities` — electricity, water, internet, bills\n   - `transport` — fuel, rides, tolls, transit\n   - `entertainment` — shows, events, streaming, leisure\n   - `other` — anything else\n4. Ensure totals reconcile: `subtotal + tax = total` (if totals conflict, trust the printed total and adjust subtotal/tax accordingly).\n5. Output strict JSON only. No comments, markdown, or additional text.\n',
  },
  {
    role: "user",
    content:
      "Please extract the merchant, date, totals, and line items from this receipt. Return valid JSON that matches the schema.",
    images: [
      "",
    ],
  },
];

const response = await ollama.chat({
  model: "qwen3-vl:235b",
  messages: messages,
  stream: false,
});

